PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "members" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "fname" varchar(255), "lname" varchar(255), "phone" varchar(255), "accesscard" varchar(255), "fsqtoken" varchar(255), "fbtoken" varchar(255), "twitoken" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "confirmation_token" varchar(255), "confirmed_at" datetime, "confirmation_sent_at" datetime, "unconfirmed_email" varchar(255), "failed_attempts" integer DEFAULT 0, "unlock_token" varchar(255), "locked_at" datetime, "authentication_token" varchar(255), "handle" varchar(255), "last_access" varchar(255), "vend_enabled" boolean, "vend_credits" integer, "vend_total" integer, "yubico" varchar(255), "is_admin" boolean, "is_lockedout" boolean, "is_private" boolean, "avatar_file_name" varchar(255), "avatar_content_type" varchar(255), "avatar_file_size" integer, "avatar_updated_at" datetime, "checkin_picture_file_name" varchar(255), "checkin_picture_content_type" varchar(255), "checkin_picture_file_size" integer, "checkin_picture_updated_at" datetime);
CREATE TABLE "guests" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "fname" varchar(255), "lname" varchar(255), "email" varchar(255), "phone" varchar(255), "interests" text, "date_in" datetime, "date_out" datetime, "badgeprinted" boolean, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "handle" varchar(255));
CREATE TABLE "roles" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "member_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_members_on_email" ON "members" ("email");
CREATE UNIQUE INDEX "index_members_on_reset_password_token" ON "members" ("reset_password_token");
COMMIT;
